import React from "react";
import PropTypes from "prop-types";

const Navbar = ({ title }) => {
  return (
    <div className="navbar">
      <h1></h1>
    </div>
  );
};

Navbar.propTypes = {
  title: PropTypes.string,
};

Navbar.defaultProps = {
  title: "Enter your title here.",
};

export default Navbar;
